const db = require('../../../data/knex-db');
const messages = require('../../../messages/charity');
const Timestamp = require('../../scalarType/Timestamp');
const { Headers } = require('cross-fetch');
const request = require('request');
global.Headers = global.Headers || Headers;


const resolvers = {
    Timestamp,

    Query: {
    },

    Mutation: {
        createCharity: async (parent, args, context) => {
            try {
                let result = await db.transaction(async trx => {
                    const bodyData = args.bodyData;

                    let check = await doRequest('https://api.charitycommission.gov.uk/register/api/allcharitydetails/' + bodyData.Charity_Commission_No + '/0');
                    if (check != 404) {
                        const charityUser = await trx.table('Charity').where('Charity_Name', bodyData.Charity_Name).first();
                        const charityNumber = await trx.table('Charity').where('Charity_Commission_No', bodyData.Charity_Commission_No).first();
                        if (charityUser && charityNumber) {
                            return {
                                messageCode: 404,
                                message: 'There is a Charity of this name / number already registered on Moves. Please contact Moves Matter to discuss'
                            }
                        }

                        let Moves_Charity_ID = null;
                        await trx.table('Charity')
                            .insert({
                                Charity_Name: bodyData.Charity_Name,
                                Charity_Commission_No: bodyData.Charity_Commission_No,
                                Contact_Name: bodyData.Contact_Name,
                                Contact_Email: bodyData.Contact_Email, 
                                Contact_Phone_Number: bodyData.Contact_Phone_Number
                            }).returning('Moves_Charity_ID').then(async (rst) => {
                                Moves_Charity_ID = rst[0]
                            })

                        if (!Moves_Charity_ID) {
                            return {
                                messageCode: 500,
                                message: messages.error
                            }
                        }
                        return {
                            messageCode: 200,
                            message: 'Thank you for your application to register with Moves Matter. We will carry out the necessary checks and get back to you at this email address. Here is your Moves reference number'
                        }
                    }
                    else {
                        return {
                            messageCode: 404,
                            message: 'Charity not found on Charity Commission database. Please check Charity Name / Number'
                        }
                    }
                });

                return result;
            }
            catch (error) {
                return {
                    messageCode: 500,
                    message: error
                }
            }
        },

    },
}

function doRequest(url) {
    let option = {
        url: url,
        headers: {
            'Ocp-Apim-Subscription-Key': 'a590ab9cb31849ecbd1cf492e4834795',
            'Cache-Control': 'no-cache',
        }
    };
    return new Promise(function (resolve, reject) {
        request(option, function (error, res, body) {
            if (res.statusCode == 200)
                resolve(body);
            else
                resolve(res.statusCode);
        });
    });
}

module.exports = resolvers;

