sourcesContent:
const db = require('../../../data/knex-db');
const authenticated = require('../../../middleware/authenticated-guard');

const resolvers = {
  Query: {
    getDashboardProfile: authenticated(async (parent, args, context) => {
      try {
        let User_ID = context.currentUser.User_ID;
        let User = await db.table('User').where('User_ID', User_ID).first();
        
        //Charity
        if (args.type == 1) {
          let Moves_Charity_ID = User.Moves_Charity_ID;
          
          if (!Moves_Charity_ID) {
            return {
              messageCode: 404,
              message: 'Charity ID is not exists',
            };
          }
          
          let Charity = await db.table('Charity').where('Moves_Charity_ID', Moves_Charity_ID).first();
          let listCharitySectorID = await db.table('Charity_Sector')
            .where('Moves_Charity_ID', Moves_Charity_ID)
            .select('Category_ID');
          
          let listCharitySector = await db.table('Category')
            .whereIn('Category_ID', listCharitySectorID.map(x => x.Category_ID))
            .select('Category_Name');

          let Charity_Geographical_Scope = await db.table('Category')
            .where('Category_ID', Charity.Charity_Geographical_Scope).first();
          let Charity_Income_Band = await db.table('Category')
            .where('Category_ID', Charity.Charity_Income_Band_ID).first();

          return {
            Charity: {
              Moves_Charity_ID: Charity.Moves_Charity_ID,
              Charity_Name: Charity.Charity_Name,
              Charity_Commission_No: Charity.Charity_Commission_No,
              Contact_Name: Charity.Contact_Name,
              Contact_Email: Charity.Contact_Email,
              Contact_Phone_Number: Charity.Contact_Phone_Number,
              Charity_URL: Charity.Charity_URL,
              Charity_Aims: Charity.Charity_Aims,
              Charity_icon: Charity.Charity_icon,
              Charity_Geographical_Scope: Charity.Charity_Geographical_Scope,
              Charity_Income_Band_ID: Charity.Charity_Income_Band_ID,
              Charity_Date_Founded: Charity.Charity_Date_Founded,
              Date_Active: Charity.Date_Active,
              Charity_Geographical_Scope_Name: Charity_Geographical_Scope?.Category_Name,
              Charity_Income_Band_Name: Charity_Income_Band?.Category_Name,
              Charity_Sector: listCharitySector.map(x => x.Category_Name).join(", "),
            },
            Company: null,
            messageCode: 200,
            message: 'Success',
          }
        }
        //Company
        else if (args.type == 2) {
          let Moves_Company_ID = User.Moves_Company_ID;
          
          if (!Moves_Company_ID) {
            return {
              messageCode: 404,
              message: 'Company ID is not exists',
            };
          }

          let Company = await db.table('Company').where('Moves_Company_ID', Moves_Company_ID).first();

          return {
            Company: {
              Moves_Company_ID: Company.Moves_Company_ID,
              Company_Name: Company.Company_Name,
              Company_Number: Company.Company_Number,
              Company_URL: Company.Company_URL,
              Company_Icon: Company.Company_Icon,
              Company_CSR_Statement: Company.Company_CSR_Statement,
              Is_Active: Company.Is_Active,
              Contact_Name: Company.Contact_Name,
              Contact_Email: Company.Contact_Email,
              Contact_Phone_Number: Company.Contact_Phone_Number
            },
            Charity: null,
            messageCode: 200,
            message: 'Success',
          }
        }
        //Admin
        else if (args.type == 3) {
          
        }
        //Charity Directory
        else if (args.type == 4) {
          
        }
        //Company Directory
        else if (args.type == 5) {
          
        }

        return {
          messageCode: 200,
          message: 'Success',
        };
      }
      catch (e) {
        return {
          message: 'Internal Server Error',
          messageCode: 500
        }
      }
    }),
    getDashboardAccountInfo: authenticated(async (parent, args, context) => {
      try {
        let User_ID = context.currentUser.User_ID;
        let User = await db.table('User').where('User_ID', User_ID).first();

        return {
          Role: '',
          User_Id: User_ID,
          User_Name: User.User_Name,
          User_Email: User.User_Email,
          messageCode: 200,
          message: 'Success',
        };
      }
      catch (e) {
        return {
          message: 'Internal Server Error',
          messageCode: 500
        }
      }
    }),
    getDashboardNews: authenticated(async (parent, args, context) => {
      try {
        let User_ID = context.currentUser.User_ID;
        let User = await db.table('User').where('User_ID', User_ID).first();
        let listNew = [];

        //Charity
        if (args.type == 1) {
          let Moves_Charity_ID = User.Moves_Charity_ID;
          
          if (!Moves_Charity_ID) {
            return {
              messageCode: 404,
              message: 'Charity ID is not exists',
            };
          }
          
          listNew = await db.table('News_Item')
          .select('News_Item_ID', 'News_Image', 'News_Title', 'News_Content')
          .where('News_Publish', true)
          .andWhere('Moves_Charity_ID', User.Moves_Charity_ID)
          .orderBy('News_Publish_Date', 'desc')
          .limit(3);
        }
        //Company
        else if (args.type == 2) {
          let Moves_Company_ID = User.Moves_Company_ID;
          
          if (!Moves_Company_ID) {
            return {
              messageCode: 404,
              message: 'Company ID is not exists',
            };
          }

          listNew = await db.table('News_Item')
          .select('News_Item_ID', 'News_Image', 'News_Title', 'News_Content')
          .where('News_Publish', true)
          .andWhere('Moves_Company_ID', User.Moves_Company_ID)
          .orderBy('News_Publish_Date', 'desc')
          .limit(3);
        }
        //Admin
        else if (args.type == 3) {
          
        }
        //Charity Directory
        else if (args.type == 4) {
          
        }
        //Company Directory
        else if (args.type == 5) {
          
        }

        return {
          listNew: listNew,
          messageCode: 200,
          message: 'Success',
        };
      }
      catch (e) {
        return {
          message: 'Internal Server Error',
          messageCode: 500
        }
      }
    }),
    getDashboardReport: authenticated(async (parent, args, context) => {
      try {
        let User_ID = context.currentUser.User_ID;
        let User = await db.table('User').where('User_ID', User_ID).first();

        let result = null;
        //Charity
        if (args.type == 1) {
          result = await dashboardHelper(User);
        }
        //Company
        else if (args.type == 2) {
          let listCampaign = await db.table('Campaign')
            .where('Moves_Company_ID', User.Moves_Company_ID)
            .select('Campaign_ID');
          let listMapCampaignId = await db.table('Match')
            .where('Moves_Company_ID', User.Moves_Company_ID)
            .select('Campaign_ID');
          
          let listCampaignId = [...listCampaign.map(x => x.Campaign_ID), ...listMapCampaignId.map(x => x.Campaign_ID)];

          let donation = await db.table('Donation')
            .andWhere('Moves_Charity_ID', User.Moves_Charity_ID)
            .orWhereIn('Campaign_ID', listCampaignId)
            .sum('Financial_Amount');

          result = {
            totalAppeal: 0,
            totalCampaign: listCampaignId.length,
            totalDonation: donation.sum ?? 0
          };
        }
        //Admin
        else if (args.type == 3) {
          
        }
        //Charity Directory
        else if (args.type == 4) {
          
        }
        //Company Directory
        else if (args.type == 5) {
          
        }

        return {
          TotalAppeal: result?.totalAppeal,
          TotalCampaign: result?.totalCampaign,
          TotalDonation: result?.totalDonation,
          message: 'Success',
          messageCode: 200
        }
      }
      catch (e) {
        return {
          message: 'Internal Server Error',
          messageCode: 500
        }
      }
    }),
    getDashboardPreview: authenticated(async (parent, args, context) => {
      try {
        let User_ID = context.currentUser.User_ID;
        let User = await db.table('User').where('User_ID', User_ID).first();

        let Moves_Charity_ID = User.Moves_Charity_ID;
        if (!Moves_Charity_ID) {
          return {
            messageCode: 404,
            message: 'Charity ID is not exists',
          };
        }
        
        let Charity = await db.table('Charity').where('Moves_Charity_ID', Moves_Charity_ID).first();
        let result = await dashboardHelper(User);

        return {
          Charity_Name: Charity.Charity_Name,
          Charity_icon: Charity.Charity_icon,
          Charity_Aims: Charity.Charity_Aims,
          Date_Active: Charity.Date_Active,
          TotalAppeal: result.totalAppeal,
          TotalCampaign: result.totalCampaign,
          TotalDonation: result.totalDonation,
          message: 'Success',
          messageCode: 200
        }
      }
      catch (e) {
        return {
          message: 'Internal Server Error',
          messageCode: 500
        }
      }
    })
  },
  Mutation: {
    updateDashboardCharity: authenticated(async (parent, args, context) => {
      try {
        let User_ID = context.currentUser.User_ID;
        let User = await db.table('User').where('User_ID', User_ID).first();
        let Charity = args.UpdateDashboardCharityInput.Charity;
        let ListCategoryId = args.UpdateDashboardCharityInput.ListCategoryId;

        let Moves_Charity_ID = User.Moves_Charity_ID;
        if (!Moves_Charity_ID) {
          return {
            messageCode: 404,
            message: 'Charity ID is not exists',
          };
        }

        let trx_result = await db.transaction(async trx => {
          await trx.table('Charity')
            .where('Moves_Charity_ID', Moves_Charity_ID)
            .update({
              Charity_URL: Charity.Charity_URL,
              Contact_Name: Charity.Contact_Name,
              Contact_Email: Charity.Contact_Email,
              Contact_Phone_Number: Charity.Contact_Phone_Number,
              Charity_Date_Founded: Charity.Charity_Date_Founded,
              Charity_Aims: Charity.Charity_Aims,
              Charity_icon: Charity.Charity_icon,
              Charity_Geographical_Scope: Charity.Charity_Geographical_Scope,
              Charity_Income_Band_ID: Charity.Charity_Income_Band_ID,
            });

          await trx.table('Charity_Sector')
            .where('Moves_Charity_ID', Moves_Charity_ID).del();
          
          let listCharitySector = [];
          ListCategoryId.forEach(item => {
            let new_item = {
              Moves_Charity_ID: Moves_Charity_ID,
              Category_ID: item
            };
            listCharitySector.push(new_item);
          });

          await trx.table('Charity_Sector')
            .insert(listCharitySector);

          return {
            message: 'Success',
            messageCode: 200
          }
        });

        return trx_result;
      }
      catch (e) {
        return {
          message: 'Internal Server Error',
          messageCode: 500
        }
      }
    })
  }
};

async function dashboardHelper(User) {
  let listAppeal = await db.table('Appeal')
    .where('Moves_Charity_ID', User.Moves_Charity_ID);
  
  let listCampaign = await db.table('Campaign')
    .where('Moves_Charity_ID', User.Moves_Charity_ID);

  let listAppealId = listAppeal.map(x => x.Appeal_ID);
  let listCampaignId = listCampaign.map(x => x.Campaign_ID);
  
  let donation = await db.table('Donation')
    .andWhere('Moves_Charity_ID', User.Moves_Charity_ID)
    .orWhereIn('Appeal_ID', listAppealId)
    .orWhereIn('Campaign_ID', listCampaignId)
    .sum('Financial_Amount');

  return {
    totalAppeal: listAppeal.length,
    totalCampaign: listCampaign.length,
    totalDonation: donation.sum ?? 0
  }
}

module.exports = resolvers
